import styled from "styled-components";
import { Link } from "react-router-dom";

export const StyledLink = styled(Link)`
  margin-left: 10px;
  text-decoration: none;
  color: rgba(18, 97, 115, 1);
  :hover {
    color: rgba(23, 120, 19, 1);
  }
`;

export const NavItem = styled.li`
  text-decoration: none;
`;
